import React from 'react';
import {
 RegisterContainer,
 RegisterSection,
 RegisterPrimary
} from '../components/account.styles';

export default function CodeScreen() {
   return (
      <RegisterContainer>
        <RegisterSection>
          <RegisterPrimary>Enter 4-Digit Code</RegisterPrimary>
          <RegisterParagraph>
              Enter the 4-digit code that you recieved on your
              email/phone number
          </RegisterParagraph>
        </RegisterSection>
      </RegisterContainer>
   );
}
